import React from "react";

import s from "./RecipesList.module.css";

export default function RecipesList() {
  return (
    <ul className={s.RecipesList}>
      <li className={s.ListGroupItem}>Barbeque Chicken</li>
      <li className={s.ListGroupItem}>Mashed Potatoes</li>
      <li className={s.ListGroupItem}>Basic Smoothie</li>
      <li className={s.ListGroupItem}>Deruny</li>
      <li className={s.ListGroupItem}>Meatballs</li>
    </ul>
  );
}
